import Home from "./routes/Home/Home";
import Data from "./Data";
import { Route, Router } from "react-router-dom";

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <Home data={Data}></Home>;
      </Route>
      <Route></Route>
    </Router>
  );
}

export default App;
